// let c1 = "item";
// let c2 = "item";
// //item active
// let classes = c1 + " " + c2;
// let classesNew = `${classes.item} ${classes.active}`;
const Navbar = () => {
return <nav className= {classes.nav}>

      <div className= {classes.item}>
      <div>
      <a>Profile</a> 
      </div>
      <div className= {`${classes.item} ${classes.active}`}>
        <a>Message</a>
      </div>

      <div>
        <a>My calendar</a>
      </div>
      <div>
        <a>Music</a>
      </div>
      <div>
        <a>Settings</a>
      </div>
      </div>
    </nav>
}
export default Navbar;
